⁠
Butter is primarily saturated fats, the type of fat that causes an increase in "bad" LDL cholesterol. The newly popular ghee is just butter that has the protein and lactose removed. It is still butter and still has the same impacts no the body.⁠
⁠
That does not mean that you need to cut all butter out of your life for the rest of time. You can use it occasionally, but it shouldn't be included in your every day routine if you are trying to lower your cholesterol levels. Add it in places where you can enjoy it the most (in reasonable amounts). ⁠
⁠
If it is everyday, try to find a swap. Plant-based butters that do not contain hydrogenated or partially hydrogenated oils are best. Try @earthbalance. Swap in olive oil. Baked goods with olive oil are just as delicious! ⁠
⁠
No one is taking your butter from you. Instead of cutting it out and feeling deprived, prioritize where it comes from. Restaurants add a ton of butter to food so it tastes amazing. Baked goods from coffee shops do the same. Those foods are worth a butter-splurge. A pat of butter on your boiled broccoli at dinner is not. Make it worth it! ⁠
⁠
If you're ready to drop the "I'd rather die than not eat butter" mentality, first, bravo! 👏🏽 Then, head to the link in my bio to hop on the waitlist for my course on how to lower your cholesterol without feeling like you have to remove all your favorite foods! ✨⁠
